import "../styles/index.css";
import "../styles/products.css";

import { AiFillStar } from "react-icons/ai";

export default function Products() {
  return (
   <section className="card-container">

    <section className="card">
      <img src="https://m.media-amazon.com/images/I/6125yAfsJKL._AC_UX575_.jpg" alt="shoe" />
      <div className="card-details">
        <h3 className="card-title">Nike Air Monarch IV</h3>
        <section className="card-reviews">
        <AiFillStar className="rating-star" /><AiFillStar className="rating-star" /><AiFillStar className="rating-star" /><AiFillStar className="rating-star" />
        <span className="total-reviews">(123 reviews)</span>
        </section>
        <section className="card-price">
        <div className="price">$<del>200</del>140</div></section>
      </div>
      <div className="bag"><svg stroke="currentColor" fill="currentColor" stroke-width="0" viewBox="0 0 16 16" height="1em" width="1em" xmlns="http://www.w3.org/2000/svg"><path d="M1 4h14v10a2 2 0 01-2 2H3a2 2 0 01-2-2V4zm7-2.5A2.5 2.5 0 005.5 4h-1a3.5 3.5 0 117 0h-1A2.5 2.5 0 008 1.5z"></path></svg></div>
    </section>
   </section>
  )
}
